import React from "react";
import Navbar from "./navmenu/Navbar";
import Contact from "./Contact";
import { Typography, Box } from "@material-ui/core";
import { useTheme } from "@material-ui/core/styles";
import { makeStyles } from "@material-ui/core/styles";
import BlogListEntry from "./BlogListEntry";
import animalImg from "../img/animal.jpg";
import angryCatImg from "../img/angrycat.jpg";

const useStyles = makeStyles((theme) => ({
  middleContainer: {
    width: "90%",
    margin: "3rem auto 6rem auto",
    padding: "2rem",
    overflow: "hidden",
    [theme.breakpoints.up("md")]: {
      width: "60%",
    },
    border: "2px white solid",
    borderRadius: ".7rem",
  },
}));

const Blogs = () => {
  const classes = useStyles();
  const theme = useTheme();
  return (
    <>
      <Navbar />
      <Box className={classes.middleContainer}>
        <Typography
          variant="h1"
          style={{
            margin: "1em 0 .8em 0",
            textAlign: "center",
            fontSize: "2rem",
            lineHeight: "1.15rem",
          }}
        >
          my current blogs
        </Typography>
        <Typography
          variant="h2"
          style={{
            margin: "0 0 3em 0",
            padding: "0 0 2em 0",
            textAlign: "center",
            fontSize: "1.2rem",
            borderBottom: `2px ${theme.palette.accent1.main} solid`,
          }}
        >
          sorry in advance
        </Typography>
        <BlogListEntry
          image={animalImg}
          title='"animal"'
          subtitle='the picture I found when I searched "animal" on google'
          bloglink="animals"
          date="August 15, 2020"
        />
        <BlogListEntry
          image={angryCatImg}
          title="fan of cats"
          subtitle="the story of me and cats"
          bloglink="fanofcats"
          date="August 15, 2020"
        />
        more coming soon...
      </Box>
      <Contact />
    </>
  );
};

export default Blogs;
